#include <iostream>

using namespace std;

void Print(int* arr, int size) {
	for (int i = 0; i < size; i++) {
		cout << arr[i] << " ";
	}
	cout << endl;
}

void Fill(int* arr, int size) {
	for (int i = 0; i < size; i++) {
		arr[i] = rand() % 10;
	}
}

bool IsSimple(int number) {
	for (int i = 2; i < number; i++) {
		if (number % i == 0) {
			return false;
		}
	}
	return true;
}

int main() {
	// —É–¥–∞–ª–µ–Ω–∏–µ –∏–∑ –º–∞—Å—Å–∏–≤–∞ –≤—Å–µ –ø—Ä–æ—Å—Ç—ã–µ —á–∏—Å–ª–∞
	srand(time(NULL));
	setlocale(LC_ALL, "ru");

	int size;
	cout << "–í–≤–µ–¥–∏—Ç–µ —Ä–∞–∑–º–µ—Ä –º–∞—Å—Å–∏–≤–∞: ";
	cin >> size;

	int* arr = new int[size];

	Fill(arr, size);
	Print(arr, size);

	int count = 0;
	for (int i = 0; i < size; i++) {
		if (!IsSimple(arr[i])) {
			count++;
		}
	}

	int* result = new int[count];

	count = 0;
	for (int i = 0; i < size; i++) {
		if (!IsSimple(arr[i])) {
			result[count] = arr[i];
			count++;
		}
	}

	delete[] arr;
	arr = result;
	size = count;

	Print(arr, size);

	delete[] result;
}

ostream& operator<<(ostream& os, const BusesForStopResponse& r) {
    if (r.buses.empty()) {
