    cout << a << endl; // 12

    a = a + 3; // –∏–∑–º–µ–Ω–∏–ª–∏ –∑–Ω–∞—á–µ–Ω–∏–µ –ø–µ—Ä–µ–º–µ–Ω–Ω–æ–π –∞ (—É–≤–µ–ª–∏—á–∏–ª–∏ –Ω–∞ 3)
    cout << a << endl;

    a += 3; // —Ä–∞–≤–Ω–æ—Å–∏–ª—å–Ω–æ  a = a + 3
    cout << a << endl;

    a -= 3; // —Ä–∞–≤–Ω–æ—Å–∏–ª—å–Ω–æ  a = a - 3
    cout << a << endl;

    a *= 3; // —Ä–∞–≤–Ω–æ—Å–∏–ª—å–Ω–æ  a = a * 3
