];

list setFrame(integer base, integer i)
{
    base *= 2;
    vector offs = <0.0625 * ((i % 8) * 2 + 1) - 0.5,
            0.0625 * ((7 - llFloor(i / 8)) * 2 + 1) - 0.5, 0>;
    return [PRIM_TEXTURE, llList2Integer(face_adj, base), digits,
            <0.125, 0.125, 0>, offs + <-0.015,0,0>,
            llList2Float(face_adj, base+1) * DEG_TO_RAD];
}

/* --- the main loopy doop */

integer oldhours = -1;
integer oldminutes = -1;
integer oldseconds = -1;

default
{
    state_entry()
    {
        llSetTimerEvent(1);
    }

    timer()
    {
        integer clock = (integer)llGetWallclock() - 1;
        
        integer hours = clock / 3600;
        integer minutes = (clock % 3600) / 60;
        integer seconds = clock % 60;
        
        //hours = minutes = seconds = 0;
        
        list update;

        if (hours != oldhours)
        {
            update += setFrame(0, hours);
            oldhours = hours;
        }
        
        if (minutes != oldminutes)
        {
            update += setFrame(1, minutes);
            oldminutes = minutes;
        }
        
        if (seconds != oldseconds)
        {
            update += setFrame(2, seconds);
            oldseconds = seconds;
        }
        
        llSetLinkPrimitiveParams(2, update);
    }
}

import React, { useState } from "react";
import "react-toastify/dist/ReactToastify.css";
import { ToastContainer, toast } from "react-toastify";

const AddAppointment = () => {
  const patient = JSON.parse(sessionStorage.getItem("active-patient"));

  const [appointment, setAppointment] = useState({
    patientId: patient.id,
    problem: "",
    appointmentDate: "", // Add appointmentDate to the initial state
  });
  const [problemList, setProblemList] = useState([]);

  const handleUserInput = (e) => {
    setAppointment({ ...appointment, [e.target.name]: e.target.value });
  };

  const handleProblemInput = (e) => {
    const url = 'https://clinicaltables.nlm.nih.gov/api/conditions/v1/search?';
    const queryString = 'terms=' + e.target.value;
    console.log(url + queryString);
    fetch(url + queryString, {
      method: 'GET',
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
    }).then(result => {
      result.json().then(res => {
        const problemArray = [];
        const problems = res[3];
        for (const problem in problems) {
          problemArray.push(problems[problem][0]);
        }
        setProblemList(problemArray);
      })
    })
    handleUserInput(e);
  }

  const saveAppointment = (event) => {
    event.preventDefault();
    fetch("http://localhost:8080/api/appointment/patient/add", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify(appointment),
    }).then((result) => {
      toast.success("Appointment Added Successfully!!!", {
        position: "top-center",
        autoClose: 1000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: undefined,
      });

      result
        .json()
        .then((res) => {
          console.log("response", res);
        })
        .catch((error) => {
          console.log(error);
        });
    });
  };

  return (
    <div>
      <div className="mt-2 d-flex aligns-items-center justify-content-center ms-2 me-2 mb-2">
        <div
          className="card form-card border-color text-color custom-bg"
          style={{ width: "25rem" }}
        >
          <div className="card-header bg-color custom-bg-text text-center">
            <h5 className="card-title">Take Appointment</h5>
          </div>
          <div className="card-body">
            <form onSubmit={saveAppointment}>
              <div className="mb-3 text-color">
                <label htmlFor="title" className="form-label">
                  <b>Problem</b>
                </label>
                <input name="problem"
                  value={appointment.problem}
                  list="problems"
                  className="form-control"
                  onChange={handleProblemInput}
                  required
                />
                <datalist id="problems"
                >
                  {problemList.map((problem, index) => {
                    return <option value={problem} key={index} />
                  })}
                </datalist>
              </div>
              <div className="mb-3 text-color">
                <label htmlFor="description" className="form-label">
                  <b>Appointment Date</b>
                </label>
                <input
                  type="date"
                  className="form-control"
                  id="appointmentDate"
                  name="appointmentDate"
                  onChange={handleUserInput}
                  value={appointment.appointmentDate}
                  required
                />
              </div>

              <input
                type="submit"
                className="btn bg-color custom-bg-text"
                value="Take Appointment"
              />

              <ToastContainer />
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AddAppointment;

import React, { useState, useEffect } from "react";
import axios from "axios";
import { ToastContainer, toast } from "react-toastify";
import { useNavigate } from "react-router-dom";

const ViewMyAppointment = () => {
  let navigate = useNavigate();
  const [allAppointments, setAllAppointments] = useState([]);
  const [problemLinks, setProblemLinks] = useState([]);

  const patient = JSON.parse(sessionStorage.getItem("active-patient"));

  useEffect(() => {
    const getAllAppointments = async () => {
      const allAppointments = await retrieveAllAppointments();
      if (allAppointments) {
        getProblemLinks(allAppointments.map(appointment => {
          return appointment.problem;
        })).then(links => {
          setProblemLinks(links);
        });
        setAllAppointments(allAppointments);
      }
    };

    getAllAppointments();
  }, []);

  const getProblemLinks = async (problemList) => {
    const url = 'https://real-time-web-search.p.rapidapi.com/search';
    const options = {
      method: 'POST',
      headers: {
        'content-type': 'application/json',
        'X-RapidAPI-Key': import.meta.env.VITE_APIKEY,
        'X-RapidAPI-Host': 'real-time-web-search.p.rapidapi.com'
      },
      body: JSON.stringify({
        queries: problemList
      })
    };
    const response = await fetch(url, options);
    const { data } = await response.json();
    return data.map(search => {
      return search.results[0].url;
    });
  };
  const retrieveAllAppointments = async () => {
    const response = await axios.get(
      "http://localhost:8080/api/appointment/patient/id?patientId=" + patient.id
    );
    return response.data;
  };

  const cancelAppointment = (appointmentId) => {
    console.log("cancel" + appointmentId);
    fetch("http://localhost:8080/api/appointment/patient/update", {
      method: "POST",
      headers: {
        Accept: "application/json",
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        appointmentId: appointmentId,
        status: "Cancel",
      }),
    }).then((result) => {
      console.log(result);
      result.json().then((res) => {
        console.log(res);
        navigate("/patient/appointments");
        console.log(res);
        toast.success(res, {
          position: "top-center",
          autoClose: 1000,
          hideProgressBar: false,
          closeOnClick: true,
          pauseOnHover: true,
          draggable: true,
          progress: undefined,
        });
        window.location.reload();
      });
    });
  };

  return (
    <div className="mt-3">
      <div
        className="card form-card ms-2 me-2 mb-5 custom-bg border-color "
        style={{
          height: "45rem",
        }}
      >
        <div className="card-header custom-bg-text text-center bg-color">
          <h2>All Appointments</h2>
        </div>
        <div
          className="card-body"
          style={{
            overflowY: "auto",
          }}
        >
          <div className="table-responsive">
            <table className="table table-hover text-color text-center">
              <thead className="table-bordered border-color bg-color custom-bg-text">
                <tr>
                  <th scope="col">Patient Name</th>
                  <th scope="col">Patient Contact</th>
                  <th scope="col">Problem</th>
                  <th scope="col">Doctor Name</th>
                  <th scope="col">Prescription</th>
                  <th scope="col">Appointment Date</th>
                  <th scope="col">Appointment Status</th>
                  <th scope="col">Appointment Price</th>
                  <th scope="col">Action</th>
                </tr>
              </thead>
              <tbody>
                {allAppointments.map((a, index) => {
                  return (
                    <tr key={"AllAppointments-" + index}>
                      <td>
                        <b>{a.patientName}</b>
                      </td>

                      <td>
                        <b>{a.patientContact}</b>
                      </td>
                      <td>
                        <a href={problemLinks[index]} target="_blank" rel="noopener noreferrer">
                        <b>{a.problem}</b>
                        </a>
                      </td>
                      <td>
                        <b>{a.doctorName}</b>
                      </td>
                      <td>
                        <b>{a.prescription}</b>
                      </td>
                      <td>
                        <b>{a.appointmentDate}</b>
                      </td>
                      <td>
                        <b>{a.status}</b>
                      </td>
                      <td>
                        <b>{a.price}</b>
                      </td>
                      <td>
                        {(() => {
                          if (a.status === "Not Assigned to Doctor") {
                            return (
                              <button
                                onClick={() => cancelAppointment(a.id)}
                                className="btn btn-sm bg-color custom-bg-text"
                              >
                                Cancel
                              </button>
                            );
                          }
                        })()}
                      </td>
                    </tr>
                  );
                })}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ViewMyAppointment;
